pub enum ContractError {

    #[error("{0}")]
    Std(
        #[from]
        StdError),

    #[error("Unauthorized")]
    Unauthorized {
    },

    #[error("No Range")]
    NoRange {
    },

    #[error("No {denom} tokens sent")]
    EmptyBalance {
        denom: String,
    },

    #[error("Cannot set to own account")]
    CannotSetOwnAccount {
    },

    #[error("Invalid zero amount")]
    InvalidZeroAmount {
    },

    #[error("Allowance is expired")]
    Expired {
    },

    #[error("No allowance for this account")]
    NoAllowance {
    },

    #[error("Minting cannot exceed the cap")]
    CannotExceedCap {
    },
}

pub enum HandleMsg {

    /// Transfer is a base message to move tokens to another account without triggering actions
    UpdateOwner {
        owner: HumanAddr,
    },
    UpdatePoolTokenContract {
        pool_token: HumanAddr,
    },
    UpdateDecasinoTokenContract {
        decasino_token: HumanAddr,
    },
    AddGameContract {
        game_contract: HumanAddr,
    },
    RemoveGameContract {
        game_contract: HumanAddr,
    },
    Deposit {
    },
    Receive(Cw20ReceiveMsg),
    Withdraw {
        amount: Uint128,
    },
    Play {
        result: bool,
        bet_amount: Uint128,
        prize_amount: Uint128,
        winner: HumanAddr,
    },
}

pub enum QueryMsg {

    /// Returns the current balance of the given address, 0 if unset.
    /// Return type: BalanceResponse.
    Balance {
        address: HumanAddr,
    },

    /// Returns metadata on the contract - name, decimals, supply, etc.
    /// Return type: TokenInfoResponse.
    PoolTokenInfo {
    },
    Config {
    },
}

pub enum OldExpiration {

    /// AtHeight will expire when `env.block.height` >= height
    AtHeight {
        height: u64,
    },

    /// AtTime will expire when `env.block.time` >= time
    AtTime {
        time: u64,
    },

    /// Never will never expire. Used to distinguish None from Some(Expiration::Never)
    Never {
    },
}
